window.bookSummaryJSON = "<p>In the cold Toronto winter of 1895, the naked body of a servant girl is found frozen in a deserted laneway. The young victim was pregnant when she died. Detective William Murdoch soon discovers that many of those connected with the girl's life have secrets to hide. Was her death on attempt to cover up a scandal in one of the city's influential families? </p>"; 
